import React, { useEffect, useState } from 'react';

const DonneesTable = () => {
    const [donnees, setDonnees] = useState({});

    useEffect(() => {
        fetch('http://127.0.0.1:8000/api/donnees')
            .then(response => response.json())
            .then(data => {
                setDonnees(data);
            })
            .catch(error => {
                console.error('Erreur lors de la récupération des données :', error);
            });
    }, []);

    return (
        <div>
            <h1>Données</h1>
            <table>
                <thead>
                    <tr>
                        <th>Numéro de Facture</th>
                        <th>Montant HT</th>
                        <th>Taux</th>
                        <th>TVA</th>
                        <th>MontantTTC</th>
                        <th>TypeContrat</th>
                        <th>EtabliPar</th>
                        <th>EtaPayement</th>
                        <th>ModeReg</th>
                        <th>NomClient</th>
                        <th>NumBonLiv</th>
                        <th>dateBonLiv</th>
                        <th>TypeValidation</th>
                        <th>NomEmetteur</th>
                        <th>NumCheque</th>
                        <th>MontantEnc</th>
                    </tr>
                </thead>
                <tbody>
                    {donnees.factures && donnees.factures.map(facture => (
                        <tr key={facture.NumFacture}>
                            <td>{facture.NumFacture}</td>
                            <td>{facture.MontantHT}</td>
                            <td>{facture.DateFacture}</td>
                            <td>{facture.Taux}</td>
                            <td>{facture.TVA}</td>
                            <td>{facture.MontantTTC}</td>
                            <td>{facture.TypeContrat}</td>
                            <td>{facture.EtabliPar}</td>
                            <td>{facture.EtaPayement}</td>
                            <td>{facture.ModeReg}</td>
                            <td>{facture.idClient.NomClient}</td>
                            <td>{BonLivraison.NumBonLiv}</td>
                            <td>{BonLivraison.dateBonLiv}</td>
                            <td>{BonLivraison.TypeValidation}</td>
                            <td>{facture.idEmetteur.NomEmetteur}</td>
                            <td>{Cheque.NumCheque}</td>
                            <td>{Cheque.NumRemise}</td>
                            <td>{remises.MontantEnc}</td>
                            {/* Ajoutez d'autres cellules de données en fonction de vos besoins */}
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default DonneesTable;
